import React from "react";

const Student = (props) => {
  const {
    city,
    company,
    email,
    firstName,
    grades,
    id,
    lastName,
    pic,
    skill,
  } = props.info;

  let average = 0;
  for (const grade in grades) {
    average += grade;
  }
  average = average / grades.length();

  console.log(props.info);
  return (
    <div>
      <p>
        {firstName} {lastName}
      </p>
      <p>Email: {email}</p>
      <p>Company: {company}</p>
      <p>Skill: {skill}</p>
      {/* <p>Average: {average}</p> */}
    </div>
  );
};

export default Student;
